import React, { useState, useReducer } from 'react';
import classes from './StepTen.module.css';
import TagsManager from './TagsManager';

import StepTenStatic from './StepTenStatic';

import reducer, { ACTIONS, INITIAL_STATE } from './reducer';

const StepTen = () => {
	const [state, dispatch] = useReducer(reducer, INITIAL_STATE);

	const newTagHandler = (tagCategory) => {
		if (state.tagTitle.trim() === '') {
			return;
		}
		dispatch({
			type: ACTIONS.ADD_NEW_TAG,
			payload: { tagTitle: state.tagTitle, tagCategory: tagCateogy },
		});
	};

	return (
		<div className={classes['step-ten-container']}>
			<div className={classes['step-ten']}>
				<StepTenStatic />
				<TagsManager
					tags={state.firstTags}
					onTitleChange={(event) =>
						dispatch({
							type: ACTIONS.CHANGE_TITLE,
							payload: { data: event.target.value },
						})
					}
					tagTitle={state.tagTitle}
					onNewTag={newTagHandler}
					onSelectToggle={(item) => {
						dispatch({
							type: ACTIONS.TOGGLE_SELECT,
							payload: { data: item },
						});
					}}
					tagCateogory='rules'
				/>

				<TagsManager
					tags={state.secondTags}
					onTitleChange={(event) =>
						dispatch({
							type: ACTIONS.CHANGE_TITLE,
							payload: { data: event.target.value },
						})
					}
					tagTitle={state.tagTitle}
					onNewTag={newTagHandler}
					onSelectToggle={(item) => {
						dispatch({
							type: ACTIONS.TOGGLE_SELECT,
							payload: { data: item },
						});
					}}
					tagCateogory='breakthroughs'
				/>

				<TagsManager
					tags={state.thirdTags}
					onTitleChange={(event) =>
						dispatch({
							type: ACTIONS.CHANGE_TITLE,
							payload: { data: event.target.value },
						})
					}
					tagTitle={state.tagTitle}
					onNewTag={newTagHandler}
					onSelectToggle={(item) => {
						dispatch({
							type: ACTIONS.TOGGLE_SELECT,
							payload: { data: item },
						});
					}}
					tagCateogory='realizations'
				/>
			</div>
		</div>
	);
};

export default StepTen;
